import './cadastro.css';
import { useState,useEffect } from 'react';
import { useReducer } from 'react';
import axios from 'axios';
import { Navigate } from 'react-router-dom';


function Cadastro(){
    const [usersdata,setusersData]=useState()
    const[userdata,setuserData]=useState({
        nome: "",
        email: "",
        password:"",
    })
    const [validateUserName,setvalidateUserName]=useState()


    useEffect(()=>{
        console.log("teste")
    },[userdata.nome])

    const submithandler=async event=>{
        event.preventDefault()
        let verefied_email
        let verified_name
        //falta verificacoes
      try{
        const send={"nome":userdata.nome}
        const send2={"email":userdata.email}
        try{
            verified_name = await axios.post("http://localhost:8800/cadastro_verificicar_nome",{send})
            console.log(verified_name.data[0])
        }catch(err){console.log(err)}
        try{
            verefied_email= await axios.post("http://localhost:8800/cadastro_verificicar_email",{send2})
            console.log(verefied_email.data[0])
        }catch(err){console.log(err)}
        console.log(verefied_email.data[0])

        if(verefied_email.data[0]===undefined && verified_name.data[0]===undefined){
            console.log("nenhum dado")
            console.log((await axios.post("http://localhost:8800/cadastro",userdata)).data.message)
        }else{console.log("dados ja existentes")}


      }catch(erro){console.log(erro)}


    }

    const cadastroVerifier =async event=>{
        try{
            setusersData((await axios.get("http://localhost:8800/cadastro_verificicar")).data)
            let username=usersdata.some(usersdata => usersdata.NOME == userdata.nome)
            let useremail=usersdata.some(usersdata => usersdata.EMAIL == userdata.email)
            let passcodeConf=userdata.password == passwordconf
            console.log(usersdata)
            console.log( usersdata.some(usersdata => usersdata.EMAIL == userdata.email))
            console.log( usersdata.some(usersdata => usersdata.NOME == userdata.nome))
            console.log(userdata.password == passwordconf)
            console.log(passwordconf,typeof(passwordconf))
            console.log(userdata.password,typeof (userdata.password))
            console.log(userdata)

            if(!username && !useremail && passcodeConf){return 0}

            //if(usersdata.includes(userdata.email)){console.log("usuario existe")}else{console.log("usuario nao existe")}

        }catch(erro){
            console.log(erro)}
    }

    const teste=async()=>{
        let verified_name
        const send={"nome":userdata.nome}
        try{
            verified_name = await axios.post("http://localhost:8800/cadastro_verificicar_nome",{send})
            console.log(verified_name.data[0])

        }catch(err){console.log(err)}
        if(verified_name.data[0]===undefined){
            console.log("nao existe")
        }else{console.log("existe")}
    }

    const handlechanger=(e)=>{
        setuserData((prev)=>({...prev,[e.target.name]:e.target.value}))
    }

    const [passwordconf,controlPasswordconf]=useState("")
    const passwordconfHandler=(event)=>{
        controlPasswordconf(event.target.value)

    }



    return(
        <div className='cadastrar-div'>
            <form className="cadastrar-card" onSubmit={submithandler}>
            <div className='titulo'><h2>Cadastrar</h2></div>
            <div className="content-controler">
                <label className="content-description"><p>Nome Utilizador</p></label>
                <input type="text" className="input-controler " onBlur={teste} autocomplete="off"  maxlength="20"name="nome" onChange={handlechanger}></input>
                <p className={validateUserName?"valido":"invalido"}>Nome de utilizador ja existe</p>
            </div>
            <div className="content-controler">
                <label className="content-description"><p>Email</p></label>
                <input type="mail" className="input-controler" autocomplete="off" maxlength="40"name="email" onChange={handlechanger}></input>
            </div>
            <div className="content-controler">
                <label className="content-description"><p>Password</p></label>
                <input type="password" className="input-controler" autocomplete="off" name="password" onChange={handlechanger}></input>
            </div>
            <div className="content-controler">
                <label className="content-description"><p>Confirmar password</p></label>
                <input type="password" className="input-controler"  autocomplete="off" onChange={passwordconfHandler}></input>
            </div>
            <div className="content-controler-termos">
                <div  className="termos-utilizacao">
                    <input type="checkbox"></input>
                    <p className="termos">Li e aceito os</p>
                    <p className="termos-link">Termos de Utilizacao</p>
                </div>
            </div>

            <div className="content-controler">
                <button type="submit" className='cadastrar-button'> cadastrar</button>
            </div>

            <div className="content-controler-termos">
                <div  className="termos-utilizacao">
                    <p className="termos">Ja possui conta?</p>
                    <p className="termos-link">Entrar</p>
                </div>
            </div>




        </form>
        </div>

    )
}
export default Cadastro
